import { Input,
    FormLabel, } from '@chakra-ui/react'
  import {React, useState} from 'react'
const Register = (user, handleUser) => {    
  return (
    <>
        <FormLabel>Name</FormLabel>
        <Input type='email' 
            value={user.name}
            onChange={handleUser()}
            />
    </>
  )
}

export default Register
